      {List<String> columnsToSelect, bool getIsDeleted}) {
    return BundleFilterBuilder(this)
      .._getIsDeleted = getIsDeleted == true
      ..qparams.selectColumns = columnsToSelect;
  }

  BundleFilterBuilder distinct(
      {List<String> columnsToSelect, bool getIsDeleted}) {
    return BundleFilterBuilder(this)
      .._getIsDeleted = getIsDeleted == true
      ..qparams.selectColumns = columnsToSelect
      ..qparams.distinct = true;
  }

